Text:
امروز مهمون ناخونده داشتیم که از قضا شیرینی شکری دوست داشتن. از #اسنپ_فود سفارش دادیم و چیزی که تحویل گرفتیم رو در تصویر می‌بینید.
هر چند بعد از دو ساعت پول شیرینی رو به حساب‌مون واریز کردن (بدون اینکه بپرسن به کیف پول خود اسنپ) اما ما پیش مهمونمون شرمنده شدیم...
@snappfood

امروز همکارم به مناسبتی برامون از #اسنپ_فود و از #شیرینی_الف زعفرانیه رولت سفارش داد. شیرینی کاملا مونده با بوی ترشیدگی ارسال کردن و کال سنترتون به جای پیگیری در اسرع وقت، ما رو به صبوری دعوت کرد. سلامتی مردم بازیچه دست شما و تامین‌کننده‌هاتون نیست.

@snappfood

#ريتوييت_لطفا

میگم اسنپ فود شما اوکیه؟
یا برای من کلی رستوران و شیرینی فروشی یهو از دسترس خارج شده و دیگه سفارش نمیشه داد ازشون؟ یکی دو هفته ای هست این وضعیت
@snappfood

از سوپرمارکت اسنپ فور سفارش دادم کمتر از ده دقیقه سفارش رو اورد بعد دیجی سفارش میدیم بعد کلی وقت زنگ میزنه میگه نداریم
واقعا دیجی کالا فقط شعار تبلیغاتیه ولی اسنپ عمل میکنه.
@snappfood
 @Digikalajet

ساعت ۱۱ از سوپرمارکت اسنپ سفارش دادم و هنوز نرسیده دستم!
هرسری هم درخواست پشتیبانی میدم در عرض ده ثانیه پیام میاد که کارشناس پیگیری کرد و تا یه تایمی( که هردفعه هم بیشتر میشه) میرسه دستتون! خیلی بی لیاقتید #ريتويیت #اسنپ #بی‌لیاقتی 
@ExpressSnapp
 @snappfood

من صبح یه سفارش سوپر مارکت دادم، از طرف سوپر مارکت کنسل شده، حالا اسنپ پولمو برنمیگردونه!
از صبح ۱۰۰ باز زنگ زدم پشتیبانی هی میگن ثبت شده، نکنه این کیف پول دزدی جدیده؟
@snappfood

جواب نداد از اسنپ فوت چیز برگر سفارش دادم با نون سیر
@weareoneEXO
 @B_hundred_Hyun
 @layzhang

یکی از خوبی‌های برنامه Snapp Food اینه که خیلی راحت میشه به آدرس و منوی غذایی رستوران و مغازه‌های دیگه دسترسی داشت و شماره تلفن مغازه رو راحت از Google Maps یا 118 گیر آورد و تلفنی سفارش داد
البته من این کار رو در جهت حمایت از مغازه دار میکنم تا مغازه دار کمیسیون نده
@snappfood

از سوپرمارکت اسنپ شیر و تخم مرغ اینا اردر گذاشتم، لحظه ثبت سفارش یهو مغزم فرمان داد چارتش(!!) رو چک کنم ببینم جای درستی خرید زدم یا نهاین طبیعیه؟ کامیونیتی رسیدگی کنه لطفا خل شدیم رفته!
@mamadporii
 @sohaylmoradi
 #بیت_کوین

ساندویچ گرم #هایدا که دیشب از #اسنپ‌فود سفارش دادم، دیر آوردن و نصفش رو گوشت کاملا #خام فرستاده بودن. گذاشتم تو یخچال امروز بدم به #گربه های محله، حداقل اونا یک حالی کنن. 
@snappfood

از #اسنپ_فود سفارش دادن اخیرا چند بدی داره که در ادامه توضیح می‌دم.

بعد صبحش هم از عطاری اسنپ فود سفارش داده بودم که بعد ۴۵ دقیقه تماس گرفتند که نداریم :)، چند روز قبل تر هم من از اسنپ فود نان سفارش دادم که نزدیک به دو ساعت منتظر ماندم و بدجور معطل 
@snappfood
 فکر کنم من واقعا فراموش کارم که دوباره از اسنپ فود سفارش میدم

گفتم لااقل به خاطر بسته بندی نامناسب و نون بیات زنگ بزنم اطلاع بدم که نفر حدودا سی ام پشت خط بودم که بیخیالش شدم.
چند روز قبل من از اسنپ فود میوه و سیب زمینی سفارش دادم که بعد از حدود یک ساعت و نیم ساعت ۹ و نیم شب زنگ زدند که موجودی ندارند:) 
@snappfood
 @AsanPazOfficial

@wn_rwe 
یاد اونروز افتادم که تو اسنپ فود غذا سفارش دادیم و تاکید کردیم دلسترا هرچی بود لیمویی نباشه 
۷ تا دلستر لیمویی آورد

@golrokhd
 @Snappdoctor
 دومین باره که از اسنپ دکتر سفارش میدم و داروخانه داروی اصلی سفارش رو نمی فرسته
این دفعه در کمال وقاحت پول برگردونده!
مگه از سوپرمارکت خرید کردم که جای تخم مرغ اسکناس برگردونده؟! 
مگه سلامتی آدم شوخی داره؟!
@Eynollahi_ir

این چه نظارتیه که روی وندور دارین؟

یه غری هم بزنم در مورد اسنپ فود که واقعا داره ضعیف عمل می‌کنه تو رشت ،تعداد رستورانها خیلی کمه و اکثرا بی کیفیت و غذای آشغالی میدن کلا سوپرمارکت چنتا داره و اکثر روز بسته آن
برای منی که عادت کردم تمام سفارش هام رو از اسنپ فود بگیرم خیلی سخته واقعا آنقدر کیفیت پایین
@snappfood

مسافرای دله دزد دیشب #اسنپ چهار نفر دختر پسر بودن که بین راه نیم ساعت توقف کردن که تو برنامه لحاظ نکردن، حدود ۵۰۰ هزار تومن هم تنقلات خریدن ولی کرایه سفرشون پیچوندن!
اسنپ مسافر پرست کلاهتو بزار بالا تر!
@Snapp_Team
 @SnappSupport

از اسنپ میوه خریدم با قیمت بیشتر از مغازه بعد هرچی سایز غیر استاندارد (یا خیلی ریز یا خیلی درشت) و خراب بوده برام فرستادن (مثلا ۳ تا پرتقال ۱ کیلو). چند قلمش هم وزن هاش کمتره. به جای ۱ کیلو ۴۰۰ گرم لیمو فرستادن. پشتیبانی مشتری مدار!! هم میگه ما مرجوع نمی کنیم!
@snappfood
#ريتوييت

من که رفتم خودم نون خریدم و صبحانه رو هم خوردیم ولی سفارش رو لغو نمی‌کنم ببینم اسنپ کی کون گشادش رو می‌خواد جمع کنه و یه پیک پیدا کنه برای ارسال سفارش
تا الان که یه ساعت و نیم از سفارش گذشته
@snappfood

صبح از سوپرمارکت اسنپ مبلغ ۱۴۲ هزار تومن خرید کردم که بعد خرید رو کنسل کردن و پیام اومد پول به حسابتون بر میگرده، حسابم رو چک کردم و پولی نبود پس با پشتیبانی تماس گرفتم، میگه رفته به کیف پول اسنپتون! همچین چیزی داشتم نمیدونستم؟چک کردم مبلغ ۱۳۹ تومنه!
@SnappSupport
