 نان سنگک گرفتم دانه‌ای ۱۵ هزار تومان، کجای راه رو اشتباه رفتیم؟

از اسنپ مارکت کورن فلکس گرفتم ، وقتی اورد توی جعبه باز بود و از تو پلاستیکش ریخته بود تو جعبش،زنگ زدم پشتیبانی گفت فروشگاه میگه دیگه مشکل خودتونه،خواستم بگم شبیه قرعه کشیه،شاید پوچ در بیاد 
@snappfood
 @ExpressSnapp
 @Snapp_Team
 از سوپر مارکت یاران دریان شقایق پاسداران هم ممنونم:))

اسنپ گرفتم. چند دقیقه توقف زده بودم از سوپر مارکت خرید کنم. از مغازه که برگشتم راننده سرش توی صندوق عقب بود. با لیوان چای برگشت تو ماشین گفت ببخشیدا برادر من یه مقدار معتادم. خمار که می‌شم چیزی حالیم نیست. شیره خوردم الان اوکی‌ام بریم.
هیچی دیگه خواستم ازتون تشکر کنم
@Snapp_Team

رتبه ۱ منظر دانشگاه تهرانو چاپیدم ازش شیرینی گرفتم و حقیقتا خوشحالم 
@__aaabi
 گفتم بذار کاپشنتو با اسنپ بفرستم خودت نپذیرفتی قول میدم بدمش خشک شویی قبل تحویل

@marzie_25
  برای اولین فروش غیر حضوری صفحه اینستاگرام جوخه اینقدر خوشحال شدم که بعد از واریز مشتری خودم اسنپ گرفتم و رفتم لباس رو تحویل دادم و با مترو برگشتم مغازه! 
ولی هنوز بهترین خاطرهء "جوخه" حضور اولین مشتری توییتریشه، چون امیدی به تبلیغ در اینجا نداشتم، ذوق مرگ شدم

بهترین نان و شیرینی فروشی تهران تا اینجا طبق تجربه‌ی من نان و شیرینی صمون توی زَرگَنده‌ست، پیکشون رایگانه و بهترین کیفیت رو دارن. توی اسنپ فود هم هستند و مناطق وسیعی رو پوشش میدن.
ناپلئونی، گاتا و نون همبرگری گرفتیم و بسیار راضی بودیم
@snappfood

بازم گلی به گوشه جمال اسنپ وقتی تأخیر میکنه یه کد تخفیف 2 تومنی میده.
از دیجیکالا نوار تست قند خون گرفتم که ارسالش بعد از یک روز کاری بوده. موقع تکمیل دیدم 4 روز طول میکشه چون اشتراک زورکی نخریدم امروزم میگه نمیاد و پوزش میطلبیم همین. 
@Snapp_Team
@digikala

واقعا از اسنپ تماس گرفتن و مبلغ سفارش رو برگردوندن و عذرخواهی هم کردن ، یه لحظه حس کردم سوئیس زندگی می کنم ، کاش سوپر مارکت یاران دریان هم به خودش میومد :))
